window.jsData("40af9db2-4326-45f6-b974-572c34745969", [{"start":{"type":"kTopicStart","text":"// kTopicStart","params":{},"lineIndex":0},"content":"#include <stdio.h>\n\n/**\n * constants and operations\n */\nint main(int argc, char* argv[]) {\n    int x = 1234, y = 02322, z = 0x4D2;\n\n    printf(\"%d\\t%o\\t%x\\n\", x, x, x); // print format\n\n    printf(\"%d\\t%d\\t%d\\n\", x, y, z);\n}","end":{"type":"kTopicEnd","text":"// kTopicEnd","params":{},"lineIndex":35},"description":"<h3 id=\"constant-representations\">constant representations</h3>\n<ul>\n<li>constant example</li>\n</ul>\n<table>\n<thead>\n<tr>\n<th>example</th>\n<th style=\"text-align:left\">type</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>1234</td>\n<td style=\"text-align:left\">int</td>\n</tr>\n<tr>\n<td>1234L</td>\n<td style=\"text-align:left\">long int</td>\n</tr>\n<tr>\n<td>1234U</td>\n<td style=\"text-align:left\">unsigned int</td>\n</tr>\n<tr>\n<td>1234UL</td>\n<td style=\"text-align:left\">unsigned long</td>\n</tr>\n<tr>\n<td>01234</td>\n<td style=\"text-align:left\">octal</td>\n</tr>\n<tr>\n<td>0xA123</td>\n<td style=\"text-align:left\">hex</td>\n</tr>\n<tr>\n<td>1.3</td>\n<td style=\"text-align:left\">double</td>\n</tr>\n<tr>\n<td>1.3f</td>\n<td style=\"text-align:left\">float</td>\n</tr>\n<tr>\n<td>1.3L</td>\n<td style=\"text-align:left\">long double</td>\n</tr>\n</tbody>\n</table>\n<ul>\n<li>constant expression</li>\n</ul>\n<p>Constant expression will be evaluated at compile-time, no runtime overhead.</p>\n","format":"c","console":"1234\t2322\t4d2\n1234\t1234\t1234\n"}]);